script_entity_29.script:setSource("function mervinEnableRight()\
\9mervTimerRight.timer:enable()\
\9mervTimerRight.timer:start()\
\9mervTimerLeft.timer:disable()\
end\
\
function mervinEnableLeft()\
\9mervTimerLeft.timer:enable()\
\9mervTimerLeft.timer:start()\
\9mervTimerRight.timer:disable()\
end\
\
mervSecret = false\
\
function mervinPrepOnRight()\
\9for x=0,3 do\
\9\9for entity in self.go.map:entitiesAt(16 + x, 28) do\
\9\9\9if entity.projectile then\
\9\9\9\9if party.x == 15 and party.y == 28 and mervSecret == false then\
\9\9\9\9\9playSound(\"secret\")\
\9\9\9\9\9self.go.script.mervSecretOn()\
\9\9\9\9end\
\9\9\9end\
\9\9end\
\9end\
end\
\
function mervinPrepOnLeft()\
\9for x=0,3 do\
\9\9for entity in self.go.map:entitiesAt(16 + x, 28) do\
\9\9\9if entity.projectile then\
\9\9\9\9if party.x == 19 and party.y == 28 and mervSecret == false then\
\9\9\9\9\9playSound(\"secret\")\9\
\9\9\9\9\9self.go.script.mervSecretOn()\
\9\9\9\9end\
\9\9\9end\
\9\9end\
\9end\
end\
\
function mervSecretOn()\
\9playSound(\"secret\")\
\9mervTriggerR.floortrigger:disable()\
\9mervTriggerR2.floortrigger:disable()\
\9mervTriggerL.floortrigger:disable()\
\9mervTriggerL2.floortrigger:disable()\
\9mervTeleR:destroy()\
\9mervTeleL:destroy()\
\9mervSecretDoor.door:open()\
\9mervSecret = true\
end")
